import { useForm } from "react-hook-form";
import FormModel from "../FormModel/FormModel";
import InputModel from "../Input/Input";

interface FormProps {
  buttonText: string;
}

const FormRegister: React.FC<FormProps> = ({ buttonText }) => {
  const { register,  handleSubmit, formState: { errors }, } = useForm();

  const submitForm = (data: any) => {
    window.location.reload();
  };

  return (

    <>
      <FormModel onSubmit={submitForm} buttonText={buttonText}>

        <InputModel
          register={register}
          type="email"
          placeholder="Digite seu email"
          error={errors.email && "Insira uma valor v치lido para Email"}
        />
        
        <InputModel
          register={register}
          type="tel"
          placeholder="Celular"
          error={errors.email && "Insira uma valor v치lido para Celular"}
        />

        <InputModel
          register={register}
          type="text"
          placeholder="Enter your email"
          error={errors.text && "Nome ou apelido"}
        />

      </FormModel>

    </>
  );
};

export default FormRegister;
